def get_rules_mask(obj_file):
	mask = []
	mesh = oal.read_mesh(obj_file)
	for index, coordinates in enumerate(mesh):
		if coordinates[1]<70 and coordinates[2]>-35:
			mask.append(index)
	return mask

def get_circle_mask (obj_file):
	mask = []
	nose_tip_vertex = 8189
	mesh = oal.read_mesh(obj_file)
	nt_coordinates = mesh[nose_tip_vertex]
	eye_positions = oal.get_vertex_positions(obj_file, oal.basel_outer_eye_vertices)
	inter_ocular_distance = oal.calc_distance(eye_positions[0,:], eye_positions[1,:])
	distance_threshold = 1.15 * inter_ocular_distance
	for index, coordinates in enumerate(mesh):
		if oal.calc_distance(coordinates,nt_coordinates)<distance_threshold:
			mask.append(index)
	return mask


